import React from 'react'
import styled from "styled-components"
import BlankPhone from "../images/about-phone-full.svg"

const Container = styled.div`
    width: 100%;
    height: 740px;
    background-color: #fff;
    font-family: 'Lato', sans-serif;
    color: #111439;
    padding-top: 20px;
`

const ContentContainer = styled.div`
    width: 1100px;
    height: 600px;
    margin-left: 50%;
    transform: translateX(-50%);
    display: flex;
`

const TextContainer = styled.div`
    margin-left: 50px;
    // background-color: #f00;
    width: 40%;
`

const ProjectIdDiv = styled.div`
    position: absolute;
    left: -1px;
    width: 2px;
    height: 14px;
    background-color: #6318FF;
`

const ProjectId = styled.h2`
    font-size: 14px;
    color: #CDCDE3;
    margin-bottom: 20px;
    font-weight: 700;
`

const ProjectHeader = styled.h1`
    font-size: 32px;
    font-weight: 800;
`

const ProjectText = styled.p`
    margin-top: 20px;
    font-weight: 300;
    line-height: 24px;
`

const PhoneContainer = styled.div`
    width: 50%;
    margin-top: -40px;
    // background-color: #0f0;
`

const PhoneImg= styled.img`
    margin-left: 50px;
`


export default function ProjectSection () {
    return (
        <Container>
            <ContentContainer>
            <TextContainer>
            <ProjectIdDiv></ProjectIdDiv>
            <ProjectId>Who am I ?</ProjectId>
            <ProjectHeader>A Little About Me ✌️</ProjectHeader>
            <ProjectText>
                A web app for visualizing personalized Spotify data. 
                View your top artists, top tracks, recently played tracks,
                 and detailed audio information about each track. Create 
                 and save new playlists of recommended tracks based on your 
                 existing playlists and more.
            </ProjectText>
            </TextContainer>
            <PhoneContainer>
                    <PhoneImg src={BlankPhone}/>
                </PhoneContainer>
            </ContentContainer>
        </Container>
    )
}
